import React from 'react';
import Noticia from './Noticia';

const Noticias = ({noticias}) => {
    return (
        <div className="row">
            <p>Hola desde noticias</p>
            {noticias.map( noticia =>{
                <Noticia 
                    // key={noticia.url}
                    noticia={noticia}
                />
            })}
        </div>
    );
};

export default Noticias;
